script: |
  super -f text -I q2612.spq | sort > q2612.out

inputs:
  - name: q2612.spq
    data: |
      SELECT DISTINCT col2 * cor0.col2 * col0 + + ( - 32 * - col0 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q2612.out
    data: |
      1155
      26904
      601284
